import React from 'react';
import { Link } from 'react-router-dom';
import classes from './VerticalMenu.module.css';
import HeaderContent from '../HeaderConent/HeaderContent'; // Correct the import path for HeaderContent
import logo from '../../../../../Misc/logo.png'; // Import the logo

function VerticalMenu({ patientName, clientCode }) {
    return (
        <div className={classes.verticalMenu}>
            <HeaderContent patientName={patientName} clientCode={clientCode} />
            <div className={classes.sideMenu}>
                <Link to={'/'}>
                <div className={classes.logo}>
                    {/* Move the logo here */}
                    <img src={logo} alt="Logo" />
                </div>
                </Link>
                <div className={classes.patientInfo}>
                    <div className={classes.patientName}>{patientName}</div>
                    <div className={classes.clientCode}>Client Code: {clientCode}</div>
                </div>
                <nav>
                    <ul>
                        <li><Link to={'/results'}>Rezultate</Link></li>
                        <li><Link to={'/appointments'}>Consultatii</Link></li>
                        <li><Link to={'/active-appointments'}>Programari active</Link></li>
                        <li><Link to={'/make-appointment'}>Fa o programare</Link></li>
                    </ul>
                </nav>
            </div>
        </div>
    );
}

export default VerticalMenu;
